Super excited to head to the Outdoor Retail show that marks my 11th year of participation! The Outdoor Industry has enriched my work and life in more ways I can count and has ushered in my latest wave of lifelong friends and mentors with whom I continue to learn and grow. I know some folks feel a way about the show coming back to Utah, and I do respect personal choices, but I’m proud to keep my seat at the table warm, while helping support the next generation of innovative leaders in this beloved industry. 🙏🏽

